import { useEffect, useState } from "react";

const Home = () => {
  const [offers, setOffers] = useState([]);

  useEffect(() => {
    const fetchOffers = async () => {
      const response = await fetch("http://localhost:4000/api/offer");
      const data = await response.json();

      if (response.ok) {
        setOffers(data);
      }
    };
    fetchOffers();
  }, []);
  return (
    <div className="home">
      <h1>JobHunt</h1>
    </div>
  );
};

export default Home;
